// import logo from './logo.svg';
import './login.css';
import React from 'react'

import LoginForm from './registration/login-form'

class Login extends React.Component {
    render() {
        return (
            <div id="background">
                <LoginForm></LoginForm>
                <SignupForm></SignupForm>
            </div>
        )
    }
}

export default Login;
